import React from 'react';
import { Link } from 'react-router-dom';

const Home = () => {
  return (
    <div className="home">
      <h1>Inventory Management System</h1>
      <Link to="/inventory">
        <button>View Inventory</button>
      </Link>
    </div>
  );
};

export default Home;
